import React, { useState, ChangeEvent } from 'react';
import SearchIcon from '@mui/icons-material/Search';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';

interface Tour {
  id: number;
  title: string;
  description: string;
  image: {
    url: string;
    alt: string;
  };
  duration: string;
  price: string;
  tags: string[];
}

const tours: Tour[] = [
  {
    id: 1,
    title: 'Valletta City Tour ‚ú®',
    description: 'Explore the historic capital of Malta with our expert guides. Visit St. John\'s Co-Cathedral, the Grand Master\'s Palace, and more.',
    image: {
      url: 'https://images.unsplash.com/photo-1596462502278-27bfdc403348?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80',
      alt: 'Valletta City View'
    },
    duration: '4 hours',
    price: '‚Ç¨45',
    tags: ['History', 'Culture', 'Walking'],
  },
  {
    id: 2,
    title: 'Mdina & Rabat üè∞',
    description: 'Discover the ancient walled city of Mdina and its surroundings. Experience the medieval atmosphere and stunning views.',
    image: {
      url: 'https://images.unsplash.com/photo-1596462502278-27bfdc403348?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80',
      alt: 'Mdina City View'
    },
    duration: '3 hours',
    price: '‚Ç¨35',
    tags: ['History', 'Architecture', 'Walking'],
  },
  {
    id: 3,
    title: 'Blue Lagoon Cruise üö¢',
    description: 'Experience the crystal-clear waters of Comino and the famous Blue Lagoon. Perfect for swimming and snorkeling.',
    image: {
      url: 'https://images.unsplash.com/photo-1596462502278-27bfdc403348?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80',
      alt: 'Blue Lagoon View'
    },
    duration: '6 hours',
    price: '‚Ç¨55',
    tags: ['Boat', 'Swimming', 'Nature'],
  },
  {
    id: 4,
    title: 'Gozo Island Tour üåÖ',
    description: 'Visit the sister island of Malta, known for its rural charm, historical sites, and beautiful landscapes.',
    image: {
      url: 'https://images.unsplash.com/photo-1596462502278-27bfdc403348?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80',
      alt: 'Gozo Island View'
    },
    duration: '8 hours',
    price: '‚Ç¨65',
    tags: ['History', 'Nature', 'Full Day'],
  },
];

const Tours: React.FC = () => {
  const [searchTerm, setSearchTerm] = useState<string>('');
  const [selectedTags, setSelectedTags] = useState<string[]>([]);

  const allTags = Array.from(new Set(tours.flatMap(tour => tour.tags)));

  const filteredTours = tours.filter(tour => {
    const matchesSearch = tour.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         tour.description.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesTags = selectedTags.length === 0 || 
                       selectedTags.some(tag => tour.tags.includes(tag));
    return matchesSearch && matchesTags;
  });

  const handleTagClick = (tag: string) => {
    setSelectedTags(prev => 
      prev.includes(tag) 
        ? prev.filter(t => t !== tag)
        : [...prev, tag]
    );
  };

  const handleSearchChange = (e: ChangeEvent<HTMLInputElement>) => {
    setSearchTerm(e.target.value);
  };

  return (
    <div className="min-h-screen bg-background-warm">
      <div className="section max-w-7xl mx-auto">
        <div className="text-center mb-12">
          <h1 className="text-4xl md:text-5xl font-bold mb-4 text-primary animate-fade-in">
            Discover Malta's Beauty
          </h1>
          <p className="text-lg text-gray-600 max-w-2xl mx-auto">
            Join us on unforgettable journeys through Malta's rich history and stunning landscapes üåü
          </p>
        </div>
        
        <div className="mb-8 space-y-6">
          <div className="relative">
            <input
              type="text"
              placeholder="Search tours..."
              value={searchTerm}
              onChange={handleSearchChange}
              className="input pl-12"
            />
            <SearchIcon className="absolute left-4 top-3 text-gray-400" />
          </div>
          
          <div className="flex flex-wrap gap-2">
            {allTags.map((tag) => (
              <button
                key={tag}
                onClick={() => handleTagClick(tag)}
                className={`px-4 py-2 rounded-full text-sm font-medium transition-all duration-300
                  ${selectedTags.includes(tag)
                    ? 'bg-secondary text-white'
                    : 'bg-white text-gray-600 hover:bg-secondary hover:text-white'
                  }`}
              >
                {tag}
              </button>
            ))}
          </div>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {filteredTours.map((tour) => (
            <motion.div
              key={tour.id}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
              className="card group"
            >
              <div className="relative overflow-hidden rounded-lg mb-4">
                <img
                  src={tour.image.url}
                  alt={tour.image.alt}
                  className="w-full h-48 object-cover transform group-hover:scale-105 transition-transform duration-500"
                />
                <div className="absolute inset-0 bg-black bg-opacity-20 group-hover:bg-opacity-10 transition-all duration-300" />
              </div>
              
              <h3 className="text-xl font-bold mb-2 text-primary">{tour.title}</h3>
              <p className="text-gray-600 mb-4">{tour.description}</p>
              
              <div className="flex justify-between items-center mb-4">
                <span className="text-sm text-gray-500">‚è± {tour.duration}</span>
                <span className="text-lg font-bold text-secondary">{tour.price}</span>
              </div>
              
              <div className="flex flex-wrap gap-2 mb-4">
                {tour.tags.map((tag) => (
                  <span
                    key={tag}
                    className="px-3 py-1 text-xs rounded-full bg-gray-100 text-gray-600"
                  >
                    {tag}
                  </span>
                ))}
              </div>
              
              <div className="flex gap-4">
                <Link
                  to="/book"
                  className="btn-primary flex-1 text-center"
                >
                  Book Now
                </Link>
                <button className="btn-outline flex-1">
                  Learn More
                </button>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Tours;
